import * as o from "react";
import c from "../lib/IconBase.es.js";
import e from "../defs/Notification.es.js";
const t = o.forwardRef((i, a) => /* @__PURE__ */ o.createElement(c, { ref: a, ...i, weights: e }));
t.displayName = "NotificationIcon";
const f = t;
export {
  f as Notification,
  t as NotificationIcon
};
